import React, { useState, useEffect } from 'react';
import styled from 'styled-components';

const Section = styled.section`
  border: 1px solid black;
  width: 60%;
  min-height: 400px;
  display: flex;
  flex-direction: column;
  align-items: center;
  // justify-content: center;
  background-color: lightgreen;
`;
const Header = styled.header`
  display: flex;
  flex-direction: column;
  align-items: center;
  border-bottom: 1px solid grey;
`;
const H3 = styled.h3`
  font-size: 20px;
`;
const P = styled.p`
  width: 80%;
`;

const About = () => {
  return (
    <Section>
      <Header>
        <H3>About Me</H3>
      </Header>
      <P>
        Full stack software engineer with extensive experience in learning new things quickly.  Expert Google-er and voracious student of the docs.  Architect of APIs, designer of databases.  Proficient in Javascript.
      </P>
    </Section>
  );
};

export default About;
